import { useState } from 'react';
import SkillBar from './SkillBar';
import SkillPie from './SkillPie';
import {Card, Typography} from '@mui/material';



export default function Dashboard() {
    const PIE_COLORS = ["#49416D","#A882DD","#E08D79","#E0EFDE","#01A7C2"];
    const role_map = [
        {
            "role": "Data Engineer",
            "exp": 2
        },
        {
            "role": "Analytics Engineer",
            "exp": 1
        },
        {
            "role": "Software Engineer",
            "exp": 1.2,

        },
        {
            "role": "AI Engineer",
            "exp": 1
        },
    ]

    let data = [
        {
            "name": "Snowflake",
            "exp": 3.2
        },

        {
            "name": "Python",
            "exp": 4.5
        },
        {
            "name": "Machine Learning",
            "exp": 3
        },
        {
            "name": "dbt",
            "exp": 2.2
        },
        {
            "name": "Data Visualizations",
            "exp": 2
        },

        {
            "name": "NodeJS",
            "exp": 1
        },
        {
            "name": "Web Apps",
            "exp": 2
        },
        {
            "name": "SQL",
            "exp": 5
        },
        {
            "name": "Git",
            "exp": 5
        }
    ];


    return (
        <div
            className="dash-container"
            style={{
                display:"flex"
            }}
        >

            <Card
                className=" card role-exp-pie"
                sx={{
                    padding:"30px",
                    width:"30%"
                }}
                >
                    <Typography 
                        variant='h5'
                        sx={{
                            textAlign: "left"

                        }}
                        >Roles</Typography>
                        <SkillPie name="role" role_map={role_map} pie_colors={PIE_COLORS}/>




            </Card>
            <Card
                className="card skill-exp-bar"
                sx={{
                    padding:"30px 10px 30px 20px",
                    width:"80%",
                    height:"100%"
                }}
            >
                <Typography 
                        variant='h5'
                        sx={{
                            textAlign: "left",
                            display: "flex"

                        }}
                        >Skills </Typography>
                <SkillPie name="name" role_map={data} pie_colors={PIE_COLORS}/>
                <SkillBar />

            </Card>


</div>
    );
}
